import { useGSAP } from "@gsap/react";
import gsap from "gsap";
import React,{useEffect} from "react";
import { Col } from "react-bootstrap";
import {Row} from "react-bootstrap"
function Project()
{
   useGSAP(()=>{
    gsap.from('#team',{
        opacity:0,
        scale:1,
        y:50,
        duration:1.5
        
    })
   })
   
    return(
       <Row style={{background:'red'}}>
        <Col style={{background:"pink"}} md={7} lg={5}>
        <div id="team" >
         <h1>WE DESIGN <br></br>
          TAILOR-MADE<br></br>
          IMMERSIVE<br></br>
         EXPERIENCES<br></br>
         BY ALWAYS<br></br>
         COMBINING <br></br>
         FREEDOM</h1>     
        </div>
        </Col>
       </Row>
      
    )
}
export default Project;
